function transfer(address recipient, uint256 amount) public payable {
    require(recipient != address(0), "ERC20: transfer to the zero address");
    require(msg.sender != address(0), "ERC20: transfer from the zero address");

    address sender = msg.sender;

    // Ensure sender has enough balance
    require(balanceOf(sender) >= amount, "ERC20: transfer amount exceeds balance");

    // Calculate fees
    uint256 feeAmount = (amount * _txFee) / 100;
    uint256 burnAmount = (amount * _burnFee) / 100;
    uint256 transferAmount = amount - feeAmount - burnAmount;

    // Ensure transfer amount is valid
    require(transferAmount > 0, "ERC20: transfer amount must be greater than zero");

    // Update balances
    _balances[sender] -= amount;
    _balances[recipient] += transferAmount;

    // Handle fees
    if (feeAmount > 0) {
        _balances[_FeeAddress] += feeAmount;
        emit Transfer(sender, _FeeAddress, feeAmount);
    }

    // Handle burn
    if (burnAmount > 0) {
        _totalSupply -= burnAmount;
        emit Transfer(sender, address(0), burnAmount);
    }

    // Emit transfer event
    emit Transfer(sender, recipient, transferAmount);
}

